import './index.css';
import '../components/global/css/navbar.css';
import '../components/global/css/footer.css';
import '../components/home/css/home.css';
import '../components/home/css/newscard.css';


export default function MyApp({ Component, pageProps }) {
    return <Component {...pageProps} />
}
